import React, {Component} from 'react'

export class employee extends React.Component {

 state = {

     name:"Abhi",
     empId: "101"

 }
	render() {
		return (
			<div>
			<h1>Hello {this.state.name} your EmpId is {this.state.empId}</h1>
			</div>
		)
	}
}

export default employee
